import{Products} from './products';
import content from '/content';

export default function App() {
    return (
        <div className='App'>
            {content.map(contents => (
                <Products
                key={contents.id}
               image={contents.image}
               name={contents.name}
               price={contents.price}
               totalSales={contents.total}
                />
            ))}
        </div>
    )
}
